	public function phpword(){
		$this->load->library('PHPWord');
		$this->load->library('simple_html_dom','shd');
		$this->load->library('h2d_htmlconverter');
		$arcd = $this->input->post_get("arcd");
		$where = array(
			"ar_cd"=>$arcd,
		);
		$row =  $this->common->select_row($table='kgrct','htm3, htm4',$where,$coding=false,$order_by='',$group_by='' );

		$data['content']="";
		if($row->htm3) $data['content'] .= file_get_contents('file:///'.$row->htm3);
		if($row->htm4) $data['content'] .= file_get_contents('file:///'.$row->htm4);


		$phpword = new PHPWord();
		$section = $phpword->createSection();
		$html = '<html>
<body>
	<h1>Hello 친구들</h1>
	<img src="hello.png"/>
	<ul>
		<li>하나</li>
		<li>둘</li>
	</ul>
</body>
</html>';

		$html_dom = new simple_html_dom();
		$html_dom->load($html);
		$html_arr = $html_dom->find('html',0)->children();

		$state = array(
			'phpword_object' => &$phpword,
			'base_root' => 'http://localhost',
			'base_path' => APPPATH
		);

		htmltodocx_insert_html($section, $html_arr[0]->nodes, $state);
		$objWriter = PHPWord_IOFactory::createWriter($phpword, 'Word2007');
		$objWriter->save('sample2.docx');
	}
}
